import * as React from 'react'
import Header from './Components/Header'
import { Stack , Box} from '@mui/system';
import Footer from './Components/Footer';
import Home from './Components/Home';





function App() {
  return (
    <>
    <Header/>
    <Home/>
    
    <Footer/>
    </>
    
  )
}

export default App
